import './App.css';
import Header_not_loggedin from './components/header/Header';

function App(props) {
  return (
    <div>
      <Header_not_loggedin />
      <div className='first'>
        <div style={{display: 'flex'}}>
          <div className='connection'>
            <h>
              Оставайся на связи с
            </h>
            <h>
              путешественниками
            </h>
            <h>
            Поделись своим опытом, открой для себя новые направления и свяжись с глобальным сообществом путешественников!
            </h>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
